public class Solution {
    public char[][] flip(char[][] image) {
        int m = image.length;
        if (m == 0) return new char[0][];
        int n = image[0].length;
        for (int i = 0; i < m; ++i) {
            for (int j = 0; j < n / 2; ++j) {
                char tmp = image[i][j];
                image[i][j] = image[i][n - j - 1];
                image[i][n - j - 1] = tmp;
            }
        }
        for (int i = 0; i < m; ++i) {
            boolean flag = true;
            for (int j = 0; j < n && flag; ++j) {
                if (image[i][j]!= image[i][0]) {
                    flag = false;
                }
            }
            if (flag) {
                for (int j = 0; j < n; ++j) {
                    image[i][j] = (image[i][0] == '0')? '1' : '0';
                }
            }
        }
        return image;
    }
}

